import React, { Component } from 'react';
import ReactMapboxGl, { Layer, Feature } from "react-mapbox-gl";

const Mapbox = ReactMapboxGl({
  accessToken: 'pk.eyJ1Ijoic2FzY2hhbXoiLCJhIjoiY2pueWE3NGN0MGR0YjNwbzV3Zm5udjFkZiJ9.Yhe8XyJjVRuDsBHs9SsBMw',
});

class Map extends Component {

  componentDidMount() {
  }

  handleClick(_, evt) {
    const { lng, lat } = evt.lngLat;
    console.log(evt);
    fetch(`https://api.twitter.com/1.1/geo/reverse_geocode.json?lng=${lng}&lat=${lat}`)
      .then(res => res.json())
      .then(res => console.log(res));
    // this.props.updateFeed({ lng, lat });
  }

  render() {
    return (
      <div>
        <Mapbox 
          ref="mapbox"
          style='mapbox://styles/mapbox/streets-v9'
          containerStyle={{
            height: "100vh",
            width: "100vw"
          }} 
          onClick={this.handleClick.bind(this)}
        />
      </div>
    );
  }
}

export default Map;
